import React from "react";
import { Routes, Route } from 'react-router-dom';

function Post() {
    return <Routes>
            <Route path="/" element={<MyPosts />}/>
            <Route path="/:id" element={<PostPage />}/>
        </Routes>;
}

function MyPosts() {
    return <div>My Post</div>
}

function PostPage() {
    return <div>Post Page</div>
}

export default Post;
